import React, { Component } from 'react';
import Todos from './components/Todos';
import './App.css';

class App extends Component {
  state = {
    todos: [
      {
        id: 1,
        title: 'take out the trash',
        completed: false
      },
      {
        id: 2,
        title: 'make dinner',
        completed: false
      },
      {
        id: 3,
        title: 'meeting with boss',
        completed: false
      },
    ]
  }  


  render(){
    console.log(this.state.todos);
    return (
      <div className="App">
        <header className="App-header">
        <h1>Todos</h1>
        </header>
      </div>
    );
  }
}

export default App;
